CREATE TABLE `asignaturas` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `peducativo_id` int(10) unsigned NOT NULL COMMENT 'Programa Educativo',
  `pestudio_id` int(10) unsigned NOT NULL COMMENT 'Plan Estudio',
  `code` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Código',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Nombre',
  `order` int(11) NOT NULL COMMENT 'Número de orden de presentaci+n de la asignatura',
  `hour_t_week` int(11) DEFAULT NULL COMMENT 'Número de horas teóricas dictadas en la semana',
  `hour_p_week` int(11) DEFAULT NULL COMMENT 'Número de horas prácticas dictadas en la semana',
  `prelation` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Prelaciones',
  `unid_credit` int(11) DEFAULT NULL COMMENT 'N+mero de unidades de cr+dito',
  `min_passing_grade` double(6,2) DEFAULT NULL COMMENT 'Calificación mínima aprobatoria',
  `approved_credit_unir` int(11) DEFAULT NULL COMMENT 'Unidades de Crédito Aprobadas',
  `enable_academic_index` enum('true','false') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Tomada en cuenta para índice o promedio académico',
  `enable_lost_regulation` enum('true','false') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Sujeta a pérdida por reglamento',
  `enable_official_doc` enum('true','false') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Mostrar en documentos oficiales',
  `enable_repairable` enum('true','false') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Reparable',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `asignaturas_peducativo_id_foreign` (`peducativo_id`),
  KEY `asignaturas_pestudio_id_foreign` (`pestudio_id`),
  CONSTRAINT `asignaturas_peducativo_id_foreign` FOREIGN KEY (`peducativo_id`) REFERENCES `peducativos` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `asignaturas_pestudio_id_foreign` FOREIGN KEY (`pestudio_id`) REFERENCES `pestudios` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
