INSERT INTO `institucions` VALUES (1,'ASOCIACION DE TERCIARIOS CAPUCHINOS DE VENEZUELA','J-00057016-7','institucion@email.com',NULL,1,'1000','true','100','true','true','true','true','true','true','true','true','true','MA','true',0.00,'1','338',0.00,0.00,'true',0.00,'','','Entre la ___________, domiciliada en el ____________________ del Estado Nueva Esparta e inscrita por ante La Oficina Inmobiliaria de Registro Público del Municipio _________ del Estado _________, bajo el Nro. ___, folios ____ al _____, Protocolo ________, Tomo _____, _________ Trimestre del año _________, quien de ahora en adelante y a los solos efectos del presente contrato se denominará \"LA UNIDAD EDUCATIVA\", representada en este acto por su Presidente (a) ______________________________, venezolana, mayor de edad, de este domicilio y titular de la Cédula de Identidad número ________________, facultada suficientemente por sus Estatutos Sociales, por una parte, y por la otra &gender_parent& &parent&, natural de &country_parent&, mayor de edad &txt_idparent& &idparent&, de este domicilio, Representante Legal &gender_son& &son&, quien de ahora en adelante y a los solos efectos de este contrato se denominará &t_parent&, por medio del presente documento declaramos: Que hemos convenido en celebrar, como en efecto celebramos el presente CONTRATO DE PRESTACIÓN DE SERVICIOS EDUCATIVOS, el cual se regirá por las siguientes cláusulas: PRIMERA: OBJETO. &t_parent&, contrata a la \"UNIDAD EDUCATIVA\", para que preste sus servicios educativos en beneficio de su &t_represented& y asista como estudiante regular de nuestra institución. &t_parent&, declara conocer y así lo acepta, que al formalizar la inscripción en la \"UNIDAD EDUCATIVA\" se obliga personalmente y en representación de su representado a acatar todas las disposiciones internas presentadas en el P.E.I.C. y en las Normas contenidas en los acuerdos del Manual de Convivencia del Colegio. SEGUNDA: HORARIO. La UNIDAD EDUCATIVA, se compromete a prestar sus servicios educativos, a favor &gender_son& &son&, de lunes a viernes, en un horario comprendido entre: 7:00 a.m. a 12:.m, salvo las excepciones establecidas y acordadas entre las partes. TERCERA: La \"UNIDAD EDUCATIVA\", se compromete a brindar a su &t_represented&, un servicio educativo de calidad, con el fin de lograr el desarrollo integral del mismo, sin más limitaciones que las características propias, nivel de desarrollo y ritmo evolutivo &gender_son&, específicamente aplicando el programa oficial del currículo de cada etapa de educación, emanado del Ministerio del Poder Popular para la Educación para la consecución de sus fines, igualmente &t_parent&, acepta expresamente y da su conformidad con el tipo de servicio educativo que recibirá su &t_represented&, el cual declara conocer y aceptar.Igualmente &t_parent&, cuyo &t_represented&, sea estudiante regular en LA \"UNIDAD EDUCATIVA\", declara en este mismo acto que conoce ampliamente las normas del Manual de Convivencia y que estas se consideran a los efectos legales de este contrato parte integrante del mismo. CUARTA: DURACION. El tiempo de duración del presente contrato corresponde al Periodo Escolar &period&, el cual se rige por el Calendario Escolar oficial, emitido por el Ministerio del Poder Popular para la Educación; lapso que será considerado fijo. Al término del mismo, si &t_parent& desea reinscribir &gender_son&, deberá firmar un contrato para cada Periodo Escolar. Excepcionalmente, se podrá reinscribir &gender_son& para otro Periodo Escolar sin firmar un nuevo contrato, en cuyo caso se tomará como vigente el último contrato firmado y continuará rigiéndose por las cláusulas establecidas en el mismo y las normas establecidas en el Manual de Convivencia vigente, entendiéndose que queda reformada la cláusula referida al régimen económico, la cual se ajustará de conformidad con la Gaceta Oficial emitida por el Ministerio del Poder Popular para la Educación referida al aumento del porcentaje permitido para la matrícula y mensualidades y aprobado por el Consejo Educativo; y sin que pueda considerarse con ello, que se produjo la tácita reconducción. QUINTA: OBLIGACIONES ECONÓMICAS. &t_parent& se compromete a pagar a la \"UNIDAD EDUCATIVA\", por los servicios educativos prestados durante el periodo académico &period&, los siguientes conceptos antes de la fecha de vencimiento que se indica de cada uno de ellos: &txt_concepts_pay&. Las partes convienen que la Matrícula y las Mensualidades se mantendrán para el período escolar &period& y están vigentes conforme a la Gaceta Oficial Nro. 40452, de fecha once (11) de Julio de 2014, emanada por el Ministerio del Poder Popular para la Educación conjuntamente con el SUNDDE en concordancia con la decisión tomada en Asamblea Escolar, del 08 de julio del 2015, donde se aprobó el aumento para las mensualidades, matrículas y proyecto de inversión de reposición de aires acondicionados en educación inicial, primaria y oficinas correspondientes al periodo escolar &period&. En dicha Asamblea se acordó evaluar periódicamente las mensualidades para ser sometidas a los ajustes necesarios según el índice inflacionario del país. Queda entendido entre las partes y convenido de común y mutuo acuerdo que la mensualidad correspondiente al mes de agosto, será pagada de manera fraccionada durante los meses de Octubre 2015 hasta Julio de 2016. Ambas partes declaran conocer que el incumplimiento de &t_parent& en el pago de las mensualidades que hace referencia el párrafo anterior ocasiona la amenaza al derecho a la educación del colectivo que integra la UNIDAD EDUCATIVA y da lugar a la apertura del procedimiento interno de cobranzas, establecido en el Manual de Convivencia, el cual se da por reproducido en este contrato; en virtud que todas las mensualidades constituyen el presupuesto para el funcionamiento de LA UNIDAD EDUCATIVA, y así declara conocerlo &t_parent&. Así mismo &t_parent&, declara conocer y así lo acepta que el incumplimiento en el pago de dos (2) Mensualidades consecutivas, trae como consecuencia la remisión inmediata del caso al Departamento Legal, lo cual genera la realización de un acta compromiso, así como el pago de los honorarios profesionales del abogado, y adicionalmente el de un arancel por pago tardío, el cual equivalente al diez por ciento (10) sobre el monto adeudado. Igualmente &t_parent&, declara conocer y así lo acepta, que en caso de incumplimiento del Acta Compromiso firmada en departamento legal, trae como consecuencia la remisión inmediata del caso a la Defensoría Escolar del Municipio Mariño, sin necesidad de notificación alguna, con copia a Municipio Escolar de la Zona Educativa, quienes son garantes de los derechos de niños, niñas y adolescentes; a los fines que se apertura el procedimiento respectivo. Queda establecido que &t_parent& que no posea capacidad de pago, derivado del incumplimiento reiterado en el pago de las mensualidades correspondientes al contrato de servicio educativo y del acta compromiso, y remitido a Defensoría Escolar y Municipio Escolar, estará de acuerdo y comprometido en buscar una opción que se adapte a su capacidad económica, para lo cual podrá solicitar la orientación de la Defensoría Escolar y Municipio Escolar, con el fin de garantizarle a &only_gender_son& su derecho a la educación, derecho que garantiza LA UNIDAD EDUCATIVA, con la remisión del caso a los Órganos antes mencionados, acompañado con las pruebas pertinentes. SEXTA: CLÁUSULA PENAL POR INCUMPLIMIENTO. Queda convenido entre las partes, que en caso de retiro &gender_son&, antes de la terminación del período escolar, para el cual fue contratado el servicio educativo, &t_parent&, no podrá reclamar la devolución de los pagos realizados a LA UNIDAD EDUCATIVA, quedando por consecuencia tales cantidades a favor de la misma y así declara aceptarlo &t_parent&. SÉPTIMA: LA UNIDAD EDUCATIVA, se compromete a: Preservar los vínculos familiares entre los hermanos que se encuentren dentro de LA UNIDAD EDUCATIVA. Preservar la identidad &gender_son& ofreciéndole un entorno de respeto y dignidad. Ofrecer planes en el subsistema de Educación Inicial, Primaria y Media General, que incluya educación, alimentación, higiene y aseo personal. Prestar atención especializada &gender_son&. Ofrecer actividades culturales y deportivas, de recreación esparcimiento y juego. Preservar en la medida de lo posible los objetos personales &gender_son& y/o del subsistema de Educación Inicial, Primaria y Media General solicitados y permitidos en el Manual de Convivencia. Mantener &only_gender_son& informado, dentro de su capacidad evolutiva, de los acontecimientos que ocurran en su país, en el mundo y en su comunidad. Mantener la confidencialidad de los archivos donde conste toda la información necesaria sobre &only_gender_son&, su padre, madre, representantes o personas autorizadas por estos. Mantener en condiciones óptimas las áreas educativas y recreativas de LA UNIDAD EDUCATIVA, no obstante &t_parent&, deberá contribuir a ello si por causas de fuerza mayor demostrable, la unidad educativa no pudiera mantener dichas condiciones. Todo esto de conformidad con la Ley Orgánica para la Protección del Niño, Niña y Adolescente, las normas del Manual de Convivencia y demás lineamientos emanados por la Zona Educativa del Estado Nueva Esparta y el Ministerio para el Poder Popular para la Educación. OCTAVA: LA UNIDAD EDUCATIVA, declara ofrecer a &only_gender_son& inscrito, la contratación de una póliza de seguro escolar (Plan cobertura amplia 24 horas) emanada de una Compañía de Seguros, para cubrir los posibles accidentes que puedan ocurrirle dentro y fuera de la UNIDAD EDUCATIVA, copia de la cual se entregará a &t_parent& en el momento de la suscripción y entrega de la póliza por parte de la compañía aseguradora. NOVENA: La UNIDAD EDUCATIVA, no se hace responsable por la integridad física &gender_son& en los siguientes casos: Daño proveniente de causas de fuerza mayor, como sería aquellos provocados por terremotos, inundaciones, apagones eléctricos, o cualquier otro que la UNIDAD EDUCATIVA por su naturaleza no pueda prevenir y/o evitar. En el subsistema de Educación Inicial, Primaria y Media General en caso de ocurrir la muerte &gender_son& por Síndrome de Muerte Súbita. En caso de cualquier alteración en la salud &gender_son& que se presente por la aparición de alguna enfermedad congénita no diagnosticada, desconocida por el padre, madre, representante o responsable. En los casos en que &t_parent&, no comunique a la UNIDAD EDUCATIVA sobre las enfermedades congénitas, adquiridas y/o enfermedades virales, entre otras, que pueda padecer o padezca &gender_son& al momento de ingresar diariamente a la UNIDAD EDUCATIVA, o al tener conocimiento de la misma. En los casos de accidentes ocurridos a los niños y niñas producto de su desarrollo evolutivo; tales como: caídas producto del aprendizaje para caminar, auto mordeduras o mordeduras por otros niños en la etapa oral o de socialización, aruños por uñas largas, entre otros. La UNIDAD EDUCATIVA no se hace responsable por el consumo de sustancias estupefacientes o sicotrópicas, y de ningún tipo de medicamentos por parte del alumnado; La UNIDAD EDUCATIVA no se hace responsable del (la) adolescente que no entre al colegio o se ausente de este sin permiso. Cualquier hecho fortuito o de fuerza mayor no predecible por la UNIDAD EDUCATIVA. DÉCIMA: &t_parent&, se compromete a suministrar en la Ficha de Inscripción &gender_son&, todos los datos solicitados, certificando su veracidad; Igualmente se compromete a informar oportunamente cualquier cambio en la información suministrada. &t_parent& que inscriba a un niño, niña y/o adolescente con condiciones especiales (de salud o aprendizaje), se encuentra obligado a informarle a LA UNIDAD EDUCATIVA, al momento de su inscripción o en el momento que se determine la condición; quien procederá según lo establecido en el Manual de Convivencia y respetando sus derechos especiales. En caso de que &t_parent& omita información o no sea oportunamente notificada a LA UNIDAD EDUCATIVA, no se determinará la responsabilidad de esta, ante las posibles complicaciones que puedan presentarse en el curso de la enfermedad que padezca &gender_son&; en tal caso, LA UNIDAD EDUCATIVA, tendrá la potestad de decidir sobre la permanencia &gender_son&; recomendar las líneas de acción o intervención requeridas para la permanencia &gender_son& dentro de LA UNIDAD EDUCATIVA, siempre que no amenace o viole los derechos individuales y/o los colectivos de los miembros de la Comunidad Educativa, todo ello de conformidad con lo establecido en el Manual de Convivencia. &t_parent&, se compromete igualmente a participar en todas las reuniones, de carácter Formativo e Informativo, entre otras, que a tal efecto convoque el Consejo Educativo, equipo Directivo, Coordinación Académica entre otras, de LA UNIDAD EDUCATIVA, así como a acudir a aquellas citaciones que tengan relación con su &t_represented&. A los efectos de la notificación, convocatoria o citación del representante, la misma se realizará mediante mecanismos electrónicos, para ello la UNIDAD EDUCATIVA dispone de una página web, la cual declara conocer en este acto &t_parent&, por ello todas las notificaciones, convocatorias, citaciones, entre otras, realizadas por dicho mecanismo tendrá fuerza de ley, sin necesidad que medie acuse de recibo de las mismas, por ello &t_parent& se obliga a mantener actualizado y revisar permanentemente dicho medio No se considera a un niño, niña o adolescente legalmente inscrito, mientras no haya cumplido con todos los requisitos exigidos para la inscripción. DÉCIMA PRIMERA: LA UNIDAD EDUCATIVA, en relación a la salud &gender_son& se compromete a: Llevar un registro confidencial de la Ficha de Urgencia &gender_son& donde conste toda su información médica, presentada por &t_parent&, la que se regirá por todos los puntos señalados en las cláusulas anteriores. Notificar a &t_parent&, sobre cualquier cambio que se presente en la salud &gender_son& durante su permanencia en La UNIDAD EDUCATIVA, e igualmente a solicitar su retiro oportuno en caso de presentarse esta situación. Notificar de inmediato a &t_parent& o a la persona autorizada por éste al momento de la inscripción &gender_son& sobre cualquier accidente ocurrido &gender_son&. Actuar bajo su criterio en caso necesario, cuando no se haya localizado a &t_parent& o a las personas señaladas al momento de la inscripción; cuando notificado éste, él o ella no comparezca oportunamente; o por gravedad del caso así lo amerite. Aplicar lo que sobre este punto establece el Manual de Convivencia. DECIMA SEGUNDA: El presente contrato entrará en vigencia al momento de la firma del mismo por las partes y concluirá al momento de la finalización del Período Escolar &period& ó del retiro &gender_son& de la UNIDAD EDUCATIVA; salvo lo dispuesto en la cláusula cuarta del presente contrato. DECIMA TERCERA: En caso de incumplimiento de cualquiera de las partes de las obligaciones que asume en virtud del presente contrato, la otra deberá asumir su responsabilidad legal, administrativa o judicial. DECIMA CUARTA: a los efectos de establecer el domicilio para cualquier citación y/o notificación derivado de este contrato, las partes contratantes declaran como domicilio especial: LA UNIDAD EDUCATIVA: Calle Guevara, Edificio \"Nuestra Señora del Valle\", Número 25, Porlamar, Municipio Mariño, Estado Nueva Esparta &t_parent&: &address_parent& &email_parent& &phone_parent& DÉCIMA QUINTA: Ambas partes eligen como domicilio especial y excluyente la ciudad de Porlamar, bajo la Jurisdicción de cuyos Tribunales declararán someterse. En Porlamar, a la fecha de su firma. &t_parent& &idparent& POR LA UNIDAD EDUCATIVA RIF: __________________ Fecha/Hora: &t_date& &page_break&',NULL,NULL,NULL);
